import { useState } from 'react';
import { Menu, Button, MenuItem } from '@material-ui/core';

const monthes = [
    'Janurary',
    '12:15am',
    'Callisto',
    'Dione',
    'Ganymede',
    'Hangouts Call',
    'Luna',
    'Oberon',
    'Phobos',
    'Pyxis',
    'Sedna',
    'Titania',
    'Triton',
    'Umbriel',
];

const dates = [
    "00",
    "01"
]

const years = [
    "2020",
    "2021",
    "2022",
    "2023"
] //don't have to add more

const DateSelector = ({ name }) => {
    const [anchorEl, setAnchorEl] = useState(null);
    const [m, setMonth] = useState("Month");
    const [d, setDate] = useState("Date");
    const [y, setYear] = useState("Year");

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <>
            <Button children={m} aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick} />
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
                PaperProps={{ style: { maxHeight: 200 } }}
            >
                {monthes.map((month) => (
                    <MenuItem children={month} onClick={handleMonthClick} />
                ))}

            </Menu>
            <Button children={d} aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick} />
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
                PaperProps={{ style: { maxHeight: 200 } }}
            >
                {dates.map((date) => (
                    <MenuItem children={date} onClick={handleDateClick} />
                ))}

            </Menu>
            <Button children={y} aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick} />
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={handleClose}
                PaperProps={{ style: { maxHeight: 200 } }}
            >
                {years.map((year) => (
                    <MenuItem children={year} onClick={handleYearClick} />
                ))}

            </Menu>
        </>
    );
}

export default DateSelector;
